export default function Box(props){
    function change(){
        props.setBox(()=>{
            props.box,
            props.on = !props.on
        })
    }
    const styles = {
        backgroundColor : props.on ? "black" : "none"
    }
    return (
        <div style={styles} className = "box" onClick={change}></div>
    )
}
